import React from 'react'

const Footer = () => {
    return(
        <div className='py-4 text-center bg-indigo-200 my-20'>
            MyDailyStatus é um projeto criado durante o Fullstack lab do DevPleno.<br/>
            Implementado por Cleber Araújo{''} <br/>
            <a className='hover:text-red-800' href='https://linkedin.com/in/cleber-lopes-araujo/'>linkedin</a> - <a className='hover:text-red-800' href='https://github.com/cleber-lopes-silva'>github</a>
        </div>
    )
}

export default Footer
